import { Component, OnInit, Input } from '@angular/core';
import { TransactionsInterface, TransactionsService } from '../../../transactions/services/transactions.service';
import * as jsPDF from 'jspdf'
import { formatDate } from '@angular/common';

@Component({
  selector: 'app-vote-type',
  templateUrl: './vote-type.component.html',
  styleUrls: ['./vote-type.component.css']
})
export class VoteTypeComponent implements OnInit {

  hash: string;
  signer: string;
  signature: any;
  string: string;
  end: number;
  start: number;
  @Input() transactionInfo: TransactionsInterface;
  searching = true;
  typeTransactionHex: string;

  constructor(
    public transactionService: TransactionsService
  ) { }

  ngOnInit() {
    // console.log('MODAL INFO', this.transactionInfo);
    this.start = 0;
    this.end = 40;

    this.signature = this.cutChain(this.transactionInfo.data.signature, this.start, this.end);
    this.signer = this.cutChain(this.transactionInfo.data.signer.publicKey, this.start, this.end);
    this.hash = this.cutChain(this.transactionInfo.hash, this.start, this.end);
  }

  cutChain(variable, start, end) {
    let string = '';
    while (variable.length > string.length) {
      if (string === '') {
        string += variable.substr(start, end);
      } else {
        string += `\n` + variable.substr(string.length, end);
      }
    }
    return string;
  }

  pdfCertificate() {
    // console.log('INFO PARA EL PDF', this.transactionInfo);
    var imgData = 'data:image/jpeg;base64,'

    var doc = new jsPDF({
        orientation: 'landscape',
        unit: 'mm',
        format: 'b1'
    })

    doc.addImage(imgData, 'JPEG', 1, 1, 1000, 707, '', 'NONE')
    //doc.addImage(document.getElementById("template"), 'JPEG', 1, 1, 1000, 707, '', 'NONE')
    doc.setFontSize(50)

    let dateFormat = "MM/dd/yyyy";
    let date = new Date(this.transactionInfo.timestamp);
    let timezone = -date.getTimezoneOffset();

    let leftCol = 45, secCol = 190, dateCol = 380;
    let dateRow = 255, feeRow = 295, titleRow = 335, 
      signerRow = 365, signatureRow = 425, hashRow = 515;

    doc.text(formatDate(date, dateFormat, 'en-us', timezone.toString()), dateCol, dateRow)

    doc.text('Effective Fee:', leftCol, feeRow);
    doc.text(this.transactionInfo.fee.concat(' XPX'), secCol, feeRow );

    doc.text('Title:', leftCol, titleRow);
    doc.text(this.transactionInfo.name, secCol, titleRow);

    // doc.text('Recipient:', 0.10, 1.30);
    // doc.text(this.transactionInfo.recipient.pretty(), 0.6, 1.30);

    doc.text('Signer:', leftCol, signerRow);
    doc.text(this.signer, secCol, signerRow);

    doc.text('Signature:', leftCol, signatureRow);
    doc.text(this.signature, secCol, signatureRow);

    doc.text('Hash:', leftCol, hashRow);
    doc.text(this.hash, secCol, hashRow);
    doc.save('voting_certificate.pdf');

  }
}
